import React from "react";
import DeleteIcon from "@mui/icons-material/Delete";

const Note = () => {
  return (
    <>
      <div className="note-div">
        <h1>title</h1>
        <br />
        <p>this is the content</p>
        <button>
        <DeleteIcon />
        </button>
      </div>
    </>
  );
};
export default Note;
